const Navbar = () => {
  return (
    <div className="navWraper">
      <div className="navlinks">
        <div className="logo">Logo</div>
        <div className="home">HOME</div>
        <div className="plan">PLAN&PRICEING</div>
        <div className="photo">PHOTO</div>
      </div>
    </div>
  );
};

export default Navbar;
